// src/pages/Home.js

import React from 'react';
import './Home.css'; // Ensure you have this CSS file

function Home() {
  return (
    <div className="home">
      <section className="about-me">
        <h1 className="title">About Me</h1>
        <p className="description">
          Hello! I'm <span className="highlight">Asratu</span>, a <span className="highlight">full-stack</span> software developer specializing in both front-end and back-end technologies.
          My passion for <span className="highlight">innovative solutions</span> drives me to continuously learn and grow in this field.
        </p>
        <div className="profile">
          <img src="/path-to-your-profile-image.jpg" alt="Profile" className="profile-image" />
          <p className="profile-info">
            I have <span className="highlight">[Number]</span> years of experience in <span className="highlight">[Industry/Field]</span>. My journey includes working on various projects and honing my skills in <span className="highlight">[Skills or Technologies]</span>.
          </p>
        </div>
      </section>
    </div>
  );
}

export default Home;
